		if (a1) {
			k = d[i].tim;
			if (k < a1.e) {
				if (k >= a1.s) {
					a1.d.push(d[i]);
					a2 = getP(j + 1);
					if (a2 && k >= a2.s) {
						a2.d.push(d[i]);
					}
				}
