					t.m += k[j].t;
					if (k[j].h > t.h) {
						t.h = k[j].h;
					}
					if (k[j].l < t.l) {
						t.l = k[j].l;
					}
				}
				t.c = k[j - 1].c / t.p;
				t.h /= t.p;
				t.l /= t.p;
